#ifndef __CATOmxKeyValueFlags_h__
#define __CATOmxKeyValueFlags_h__
/** default value. */
#define OMX_KEYVALUE_NONE            0x0
/** set if valuated. */
#define OMX_KEYVALUE_ISVALUATED      0x1
/** set if is multivaluated. */
#define OMX_KEYVALUE_ISMULTIVALUATED 0x2
/** Self explanatory*/
#define OMX_KEYVALUE_ALL (OMX_KEYVALUE_ISVALUATED|OMX_KEYVALUE_ISMULTIVALUATED)

#endif
